create sequence perawat_sq 
    minvalue 1 
    maxvalue 9999 
    start with 1 
    increment by 1 
    cache 20

create or replace trigger perawat_sq_trig 
before insert on perawat 
for each row 
declare 
  new_id varchar(5); 
  cur_id number; 
begin 
  if inserting and :new.id_perawat is null then 
    cur_id := perawat_sq.nextval; 
    if cur_id < 10 then 
      select concat('N000', cur_id) into new_id from dual; 
    else 
      if cur_id < 100 then 
        select concat('N00', cur_id) into new_id from dual; 
      else 
        if cur_id < 1000 then 
          select concat('N0', cur_id) into new_id from dual; 
        else 
          select concat('N', cur_id) into new_id from dual; 
        end if; 
      end if; 
    end if; 
  :new.id_perawat := new_id; 
  end if; 
end;


